import React from 'react';
// import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginPage from './pages/token';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login">
          <LoginPage />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
